import React, { Component } from 'react';
import './Menu.css';
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    Container
} from 'reactstrap';
class Menu extends Component {

    render() {
        return (
            <div className="menu">
                <Navbar color="light" light expand="md">
                    <Container>
                        <Nav className="mr-auto" navbar>
                            <NavItem>
                                <NavLink >Components</NavLink>
                            </NavItem>
                            <NavItem>
                                <NavLink >GitHub</NavLink>
                            </NavItem>

                        </Nav>

                    </Container>
                </Navbar>
            </div>
        );
    }
}

export default Menu;
